Хоккей от Sports.ru - это лучшее приложение о хоккее: онлайн трансляции, новости, статистика, расписание матчей, турнирные таблицы, общение с болельщиками и многое другое! 

Приложение Sports.ru включает:

• Новости, анонсы, тексты лучших спортивных журналистов и интервью о НХЛ, КХЛ, чемпионате мира по хоккею 2018-2019 и других турнирах;
• Онлайн трансляции матчей чм по хоккею 2018-2019, составы и статистику спортсменов;
• Полную статистику всех команд в режиме реального времени;
• Календарь и турнирные таблицы;
• Блоги и материалы пользователей Sports.ru о любимых игроках и командах;

Условия использования: https://www.sports.ru/docs/agreement.html
Политика конфиденциальности: https://www.sports.ru/docs/privacy_policy

Лига Ставок онлайн статистика - это профессиональный советник по спорту, который настроен на то, чтобы помочь людям получиться самые высокие ставки на победу. 

Лига Ставок онлайн статистика была специально разработана нашей командой экспертов и имеет удобный интерфейс, который очень прост в использовании. Мы стремились разработать «простое, но эффективное» приложение, которое будет в ваших глазах лучшим приложением для советов по ставкам.

Мы очень серьезно относимся к работе с нашими ежедневными выборами и заботой о наших пользователях. Таким образом, наше приложение для ставок подходит для всех: для профессиональных игроков, которые регулярно делают ставки на спорт, для пользователей, которые хотят улучшить ставки и даже для новых игроков, которые хотят научиться делать ставки на спорт.

Почему стоит скачать наше приложение:
- Калькулятор экспрессов без ограничения команды;
- Преобразование коэффициентов между денежной линией, десятичной дробью и дробью;
- Спортивные тизеры;
- Спортивные результаты и коэффициенты в реальном времени;
- Создание билетов по вашему выбору;
- Новости мира спорта.

There is possible to concentrate into playing game by leaving counting for machine.

Key features of the counter:
 - scoring up to 11 or to 21 (two scores difference is required for win);
 - user can select (or randomize) who will serve first, then the app will calculate who serves and will display it;
 - counting is displayed with large font in landscape orientations, herewith tap area for adding score will be almost half of screen;
 - special mode that allows scoring with volume buttons, the app speaks current state (scores, who serves); so, device can be located in a pocket;
 - recording detailed history of played games (user can view it in the app, and also can copy it to computer via iTunes);
 - user can undo activities.

Some features are unavailable with iOS 6.x and below.

Two Devices Mode is in development.
